import Article from '../components/ArticleElements/Article.js'

function HtmlPage () {
    return (
        <div>
            <Article 
                title='HTML'
                text='HTML or HyperText Markup Language defines the structure and content of webpages. An HTML element is a chunk of information surrounded by HTML tags. Here is an example of HTML that displays a header with a paragraph of text underneath:'
                code='<h1>Title of Section</h1> \n
                      <p>This is where some description goes.</p>' 
            />
        </div>

    )
}

export default HtmlPage

